INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (163,'007','때를 만났는데도 실행하지 않는다면 언제 다시 때를 기다릴 수 있겠습니까? 주저하지 말고 주어진 기회를 과감하게 포착하십시오. 큰 재물을 얻기는 어려우나 작은 재물은 필시 들어오겠습니다. 천리 밖의 있는 손님을 불러들이거나 서로 상대하려고 하지 마십시오. 다만 시기가 왔음을 알았거든 지체하지 말고 속히 도모하는 것이 길합니다. 주어진 좋은 기회를 놓치지 마십시오. 귀한 손이 도우려하다가 때가 지나면 도리어 해를 낳칠 수도 있습니다. 분수를 지키는 것이 상책이니 경고망동하지 말고 친착하게 대처해야 합니다.','가을 하늘에 구름 한점이 없이 되었으니 밝은 달이 다시 새롭게 빛을 밝히게 되었습니다. 이익은 사방에 있으니 일을 마무르 짓을 때 유념해야합니다. 식구를 늘리지 되지 않는다면 필시 관례이 있게됩니다.','마음이 하늘처럼 드넓고 뜻이 만족하였으니 재물을 구하면 필시 얻겠습니다. 이 달의 여세는 실물을 조심하십시오. 의성이 문에 빛쳤으니 큰 재물이 문에 가득 찬 것입니다. 시기를 놓치지말고 적극적으로 도전해 볼 일입니다.','올바른 마음으로 대명을 딛었으니 이익이 그 가운데 있겠으나 사람 대하기를 조심하십시오. 북방에 길함이 있으며 일을 마무르 짓거나 시작하기 전에 기회가 왔 것입니다. 좋은 기회를 놓치지 말고 포착하십시오. 만약 십하에 근심이 생긴다면 남방의 약을 쓰십시오.','악한 사람을 가까이 하지 말고 분수를 지켜서 자세를 가꾼다면 흉을 면하고 요히려 길할 것입니다. 갑인 하늘에 달이 밝게 비치니 그 빛이 가히 먼기만 합니다. 모든 일 밝게 보여 여의하니 가히 소망을 성취할 수 있겠습니다.','일을 여의찮 못하니 한번은 이르고 한번은 패하게 되겠습니다. 사람으로 인하여 패하게 될 것이니 그 해가 자지 않습니다. 상만 아니라 하는 일이 형통하게되니 이를 꾸하면 불리합니다. 새 일을 도모하지 말고 사람쓰기를 조심하십시오.','임금과 신하가 화의롭게 만나 조성하게 창달하는 격이니 귀인이 와서 도와줄 것입니다. 은인은 동방 사람입니다. 일을 새로 바람에 은혜를 베풀 사람이니 잘 영접하십시오. 새곳을 얻게되는 작은 것을 쫓아 큰 것을 이루겠습니다.','활짝 핀 매화꽃이 한집안을 아름답게 가꾸고 이웃을 밝게 비추는 격입니다. 만약 외환이 없으면 친환이 있겠으니 두렵습니다. 일은 필시 정손와 이십 성을 가진 사람이 줄 것이니 사람 사귀기를 정성스럽게 해야합니다.','경영하는 일은 귀인이 와서 도와줄 것이니 염려하지 말고 추진하십시오. 그러나 재물은 비록 왕성하다 할 지라도 얻어서 밖잠은 없어지게 될 것이니 주의해야 합니다. 후흉을 당하면 반드시 그 해가 미치 과망을 잊어서는 안됩니다.','다른 사람의 말을 잘못 믿었다가는 마침내 불리함을 알게 될 것입니다. 다른 사람과 함께 일을 꾸하게되면 두 사람의 마음이 각각 달라 어려움을 겪게됩니다. 이렇바 경영하는 것은 필시 공을 이루게 될 것이니 증단해서는 안됩니다.','동남 양방에서 귀인이 나를 도와 줄 것이니 일을 시작하여 바일 때 성의가 있다면 남의 도움을 받을 것입니다. 이익은 서쪽에 있으니 일을 마무르 찾는데 성심을 다해야합니다.','험된 욕심이 다시 발동했다가는 큰 해를 면하기 어렵겠습니다. 남의 재물을 탐내지 마십시오. 흉한 일을 면하지 못합니다. 사람을 잘못 사귀면 그로 인해 해가 있을 것이니 분수를 지키고 정도를 행하는 것만이 자신을 지키는 첩경입니다.','이익은 남방에 있으니 하던 일을 더욱 더 활발하게 펴치고 진행하는 것이 좋습니다. 그렇게 하다보면 우연이 나를 돕는 자도 생기겠습니다. 대운이 왕성하여 큰 재물이 문에 들어옵니다. 혹 도둑이 있을 지 모르니 실물을 조심하고 매사를 소홀히 하지 마십시오.','2025-03-02 03:02:00.911735+00','k');
